INSERT INTO `country` VALUES ('3', 'Egypt', 'EG', 'http://storage.ahmedabdelaziz.net/source', 'country/flags/1/a1Q8aGqzIILI28__OCZIaLVe2TkZ7UZv.jpg', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. ', 'Egypt is a country which has had many different rulers and many political systems. After World War II, Egypt was still ruled by a king, Farouk of Egypt (11 February 1920 – 18 March 1965). He was the last ruler of the Muhammad Ali dynasty.\r\n\r\nFarouk was overthrown on 23 July 1952 by a military coup. The coup was led by Muhammad Naguib, and Gamal Abdel Nasser. From then on, Egypt had military rulers or rulers who had the backing of the army and many citizens.\r\n\r\nNasser became President, from 1956 to 1970. Later rulers were Anwar Sadat, and Hosni Mubarak.\r\n\r\nAbdel Fattah el-Sisi became President in 2014.', '1', '1');
