INSERT INTO `translations_with_text` VALUES ('53', 'country', '9', 'intro', 'ar', 'ماليزيا\r\n(بالإنجليزية: Malaysia)‏  تعديل قيمة خاصية (P1448) في ويكي بيانات\r\nماليزيا\r\nعلم ماليزيا	\r\nماليزيا\r\nشعار ماليزيا\r\nMalaysia (orthographic projection).svg\r\n \r\nالشعار الوطني\r\n(بالملايوية: Bersekutu Bertambah Mutu)‏  تعديل قيمة خاصية (P1451) في ويكي بيانات\r\nالنشيد :نشيد ماليزيا الوطني  تعديل قيمة خاصية (P85) في ويكي بيانات\r\nالأرض والسكان\r\nإحداثيات	3°N 108°E  تعديل قيمة خاصية (P625) في ويكي بيانات\r\nأعلى قمة	جبل كينابالو، 4096 متر\r\nأخفض نقطة	المحيط الهندي (0 متر)  تعديل قيمة خاصية (P1589) في ويكي بيانات\r\nالمساحة	330290 كيلومتر مربع  تعديل قيمة خاصية (P2046) في ويكي بيانات\r\nعاصمة	كوالالمبور  تعديل قيمة خاصية (P36) في ويكي بيانات\r\nاللغة الرسمية	لغة المالايو\r\nلغات محلية معترف بها	الإنجليزية\r\nالتعداد السكاني	31624264 (2017)  تعديل قيمة خاصية (P1082) في ويكي بيانات\r\nمتوسط العمر	75.3 سنة (2016)\r\nالحكم\r\nنظام الحكم	ملكية دستورية\r\nالملك	عبد الله أحمد شاه\r\nرئيس الوزراء	محيي الدين ياسين\r\nالسلطة التشريعية	برلمان ماليزيا  تعديل قيمة خاصية (P194) في ويكي بيانات\r\nالتأسيس والسيادة\r\nالتاريخ\r\nتاريخ التأسيس	1957\r\nالناتج المحلي الإجمالي\r\n ← الإجمالي	314,500,279,043.81 دولار أمريكي (2017)\r\n ← الإجمالي عند تعادل القوة الشرائية	933,277,659,021 دولار جيري-خميس (2017)\r\n ← للفرد	29,511.443 دولار جيري-خميس (2017)\r\nالناتج المحلي الإجمالي الاسمي\r\n ← للفرد	9,951 دولار أمريكي (2017)\r\nمعدل نمو الناتج المحلي الإجمالي الحقيقي	4.2 نسبة مئوية (2016)\r\nإجمالي الاحتياطي	102,446,599,680 دولار أمريكي (2017)\r\nمعامل جيني\r\nالرقم	46.2 (2009)  تعديل قيمة خاصية (P1125) في ويكي بيانات\r\nمؤشر التنمية البشرية\r\nالمؤشر	\r\n0.802 (2017)  تعديل قيمة خاصية (P1081) في ويكي بيانات\r\nمعدل البطالة	2 نسبة مئوية (2014)\r\nاقتصاد\r\nمعدل الضريبة القيمة المضافة	\r\n6 نسبة مئوية  تعديل قيمة خاصية (P2855) في ويكي بيانات\r\nالسن القانونية	18 سنة  تعديل قيمة خاصية (P2997) في ويكي بيانات\r\nسن التقاعد	60 سنة  تعديل قيمة خاصية (P3001) في ويكي بيانات\r\nبيانات أخرى\r\nالعملة	رينغيت ماليزي  تعديل قيمة خاصية (P38) في ويكي بيانات\r\nالبنك المركزي	البنك المركزي الماليزي  تعديل قيمة خاصية (P1304) في ويكي بيانات\r\nمعدل التضخم	1.8 نسبة مئوية (2016)\r\nرقم هاتف\r\nالطوارئ	\r\n999 (خدمات طبية طارئة، ‏الحماية المدنية و شرطة)  تعديل قيمة خاصية (P2852) في ويكي بيانات\r\nالمنطقة الزمنية	ت ع م+08:00  تعديل قيمة خاصية (P421) في ويكي بيانات\r\nجهة السير	يسار  تعديل قيمة خاصية (P1622) في ويكي بيانات\r\nاتجاه حركة القطار	يسار  تعديل قيمة خاصية (P5658) في ويكي بيانات\r\nرمز الإنترنت	‎.my‎  تعديل قيمة خاصية (P78) في ويكي بيانات\r\nأرقام التعريف البحرية	533  تعديل قيمة خاصية (P2979) في ويكي بيانات\r\nالموقع الرسمي	الموقع الرسمي  تعديل قيمة خاصية (P856) في ويكي بيانات\r\nأيزو 3166-1 حرفي-2	MY  تعديل قيمة خاصية (P297) في ويكي بيانات\r\nرمز الهاتف الدولي	+60  تعديل قيمة خاصية (P474) في ويكي بيانات\r\nتعديل مصدري - تعديل طالع توثيق القالب\r\nماليزيا هي دولة اتحادية ملكية دستورية تقع في جنوب شرق آسيا مكونة من 13 ولاية وثلاثة أقاليم اتحادية، بمساحة كلية تبلغ 329 845 كم2. العاصمة هي كوالالمبور، في حين أن بوتراجاي هي مقر الحكومة الاتحادية. يصل تعداد السكان إلى أكثر من 32 مليون نسمة سنة 2019. ينقسم البلد إلى قسمين يفصل بينهما بحر الصين الجنوبي، هما شبه الجزيرة الماليزية وبورنيو الماليزية (المعروفة أيضاً باسم ماليزيا الشرقية). يحد ماليزيا كل من تايلند وإندونيسيا وسنغافورة وسلطنة بروناي. تقع ماليزيا بالقرب من خط الاستواء ومناخها مداري. رأس الهرم الماليزي هو\"يانغ ديبرتوان أغونغ\" وهو ملك منتخب، بينما يترأس الحكومة رئيس الوزراء. تبنى الحكومة بشكل قريب جداً من نظام وستمنستر البرلماني.');
INSERT INTO `translations_with_text` VALUES ('54', 'country', '9', 'details', 'ar', 'اتحدت ماليزيا كدولة حديثة عام 1963. في السابق، بسطت المملكة المتحدة نفوذها في مستعمرات في تلك المناطق أواخر القرن الثامن عشر. تكون النصف الغربي من ماليزيا الحديثة من عدة ممالك مستقلة. عرفت هذه المجموعة من المستعمرات باسم مالايا البريطانية حتى حلها عام 1946، عندما تم إعادة تنظيمها ضمن اتحاد الملايو. نظراً للمعارضة الواسعة، أعيد تنظيمها مرة أخرى ضمن اتحاد مالايا الفدرالي في عام 1948، ثم حصلت على الاستقلال في وقت لاحق في 31 أغسطس 1957. دمجت كل من سنغافورة، سراوق، وبورنيو الشمالية البريطانية واتحاد مالايا جميعها لتشكل ماليزيا يوم 16 سبتمبر 1963. حصلت في السنوات التالية توترات ضمن الاتحاد الجديد أدت إلى نزاع مسلح مع إندونيسيا وطرد سنغافورة في 9 أغسطس 1965.\r\n\r\nخلال أواخر القرن العشرين، شهدت ماليزيا طفرة اقتصادية وخضعت لتطور سريع. حيث يحدها مضيق ملقا، وهو طريق بحري مهم في الملاحة الدولية، كما أن التجارة الدولية جزء أساسي من اقتصادها. تشكل الصناعة أحد القطاعات الرئيسية في اقتصاد البلاد. كما انضمت ماليزيا إلى مجموعة الدول الثماني الإسلامية النامية. تمتلك ماليزيا تنوعاً حيوياً من النباتات والحيوانات، حيث تعتبر من بين الدول 17 الأكثر تنوعاً.');
